import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";

class Human {
  constructor(name, age) {
    this.name = name;
    this.age = age;
  }
}

function Welcome(props) {
  return (
    <div>
      <h1>Hello,{props.human.name}</h1>
      <h2>Your age is,{props.human.age}</h2>
    </div>
  );
}

function App() {
  return (
    <div>
      <Welcome human={new Human("alice", 27)} />
      <Welcome human={new Human("Bob", 33)} />
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<App />);
